import * as React from "react";
import css from "../styles/Schedule.module.scss";
import { Layout } from "../components";

export default function Schedule() {
  return (
    <React.Fragment>
      <Layout></Layout>
      <main className={css.main}></main>
    </React.Fragment>
  );
}
